const Loading = () => {
    return (
        <div id="component">
            <div id="circle">
                <div id="rocket">
                    <img src="/loading_rocket.png" width="150" height="150" />
                </div>
            </div>

            <style jsx>{`
                #component{
                    position: 'relative',
                    height: '100%',
                    textAlign: 'center',
                }

                #circle{
                    position: 'fixed',
                    left: '49%',
                    top: '42%',
                    transform: 'translate(-50%, -50%)',
                    borderRadius: '50%',
                    background: 'rgb(93, 49, 148)',
                    height: '100px',
                    width: '100px',
                }
            
            `}</style>
        </div>
    );
}

export default Loading
